import React from 'react'
import '../QuemSomos.css';
import 'bootstrap/dist/css/bootstrap.min.css';

import Filipe from "../images/Filipe.png";
import Thiago from "../images/Thiago.png";
import Daniel from "../images/Daniel.png";
import Wallace from "../images/Wallace.png";
import GoBlochainImg from "../images/GoBlochainImg.png";


function PqEmitirToken(){
    return (
      <div class="container ">      
        <div class="row ">
            <div class="col-12" style={{alignItems:'center', marginTop:'65px'}} >
                <div  style={{textAlign:'center'}}>
                    <h1 style={{fontWeight:'700', fontSize:'26px'}}>
                    Quem somos
                    </h1>
                    <p style={{fontWeight:'500', fontSize:'18px', marginTop:'20px', color:'#575757'}}>Conheça a equipe por trás da produção da plataforma GoTokens.</p>
                </div>
            </div>  
            
            <div>
                <div class="row" style={{marginTop:'60px'}} >
                    <div  class="col-lg-3 col-md-6 col-sm-12" >
                       
                            <img  src={Filipe} 
                                    class="img-fluid"  
                                    alt="FundoGoTokens"
                                    style={{}}
                                    >
                            </img> 
                    </div>  
                    <div class="col-lg-3 col-md-6 col-sm-12">
                       
                            <img  src={Thiago} 
                                    class="img-fluid"  
                                    alt="FundoGoTokens"
                                    style={{}}
                                    >
                            </img>
                    </div> 
                    <div  class="col-lg-3 col-md-6 col-sm-12">
                        <img  src={Daniel} 
                                    class="img-fluid"  
                                    alt="FundoGoTokens"
                                    style={{}}
                                    >
                            </img>  
                    </div> 
                    <div  class="col-lg-3 col-md-6 col-sm-12">
                            <img  src={Wallace} 
                                    class="img-fluid"  
                                    alt="FundoGoTokens"
                                    style={{}}
                                    >
                            </img>
                    </div>  
                </div>
            </div>
            <div class="col-12" style={{ marginTop:'65px', marginBottom:'70px'}} >
                <div id="equipeGoBlockChain" >
                    <button id="btnGoblockChain">
                        <p style={{fontWeight:'bold', fontSize:'18px', marginLeft:'69px', marginTop:'26px'}}>Uma equipe</p>
                    <img  src={GoBlochainImg} 
                                    class="img-fluid"  
                                    alt="FundoGoTokens"
                                    style={{marginTop:'21px',marginLeft:'17px'}}
                                    >
                            </img>
                    </button>
                </div>
            </div>  

                  
        </div>
             
      </div>
        
    );
}

export default PqEmitirToken;
